$(document).keypress(function(e){"13"==(e.keyCode||e.which)&&signIn});const signInBtn=document.getElementById("sign-in-btn"),signInBtnGoogle=document.getElementById("google-sign-in-btn"),signIn=()=>{axios.post("/signIn",{email:document.getElementById("email").value,password:document.getElementById("pass").value}).then(e=>{window.location.href="/channels"}).catch(e=>{console.log(e.response),e.response.data.msg instanceof Array&&alert(e.response.data.msg[0])})},signInGoogle=()=>{axios.get("/auth/google").then(e=>{}).catch(e=>{console.log(e.response),e.response.data.msg instanceof Array&&alert(e.response.data.msg[0]),alert(e.response.data.msg)})};signInBtn.addEventListener("click",signIn);